INSERT INTO `product` (`id`, `name`, `description`, `ingredient`, `calo`, `quantity`, `price`, `discount`, `created_time`, `updated_time`) VALUES
(1, 'Cơm tấm sườn miếng', 'Cơm tấm sườn miếng là một món ăn đặc trưng của ẩm thực miền Nam Việt Nam, đặc biệt phổ biến ở Sài Gòn. Món ăn này bao gồm cơm tấm - loại gạo vỡ đặc trưng, được nấu chín mềm, ăn kèm với miếng sườn nướng thơm lừng.\r\nSườn miếng thường là sườn lợn được ướp với hỗn hợp gia vị đậm đà, bao gồm nước mắm, tỏi, hành, đường, và một ít mật ong hoặc nước dừa để tạo độ ngọt tự nhiên. Sườn sau khi ướp được nướng trên than hoa, giúp miếng sườn vừa chín tới, giữ được độ mềm mại, mà vẫn có lớp vỏ ngoài giòn, thơm mùi khói.', 'Cơm Tấm, Sườn Cốt Lết Nướng ăn kèm Dưa Leo, Cà Chua, Đồ Chua, Mỡ Hành chấm Nước Mắm', 248, 22, 67000, 13, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(2, 'Cơm Tấm Sườn Bì Chả', 'Cơm tấm sườn bì chả là một món ăn đặc trưng của ẩm thực miền Nam Việt Nam, được yêu thích bởi sự đa dạng và phong phú trong hương vị và thành phần. Món ăn này bao gồm cơm tấm - loại gạo tấm vỡ được nấu chín mềm, ăn kèm với sườn nướng, bì và chả.', 'Cơm Tấm, Sườn nướng, Bì, Chả Trứng, Trứng Ốp', 99, 40, 88000, 13, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(3, 'Cơm Gà Hội An', 'Cơm gà Hội An là một món ăn đặc sản nổi tiếng của thành phố Hội An, tỉnh Quảng Nam, Việt Nam. Món ăn này đặc trưng bởi sự kết hợp hài hòa giữa gạo tẻ dẻo thơm, thịt gà ta mềm ngọt và các loại rau sống tươi ngon, tạo nên một hương vị độc đáo và hấp dẫn', 'Cơm, Gà, Rau sống, Nước chấm', 282, 38, 55000, 13, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(4, 'Cơm Gà Chiên Mắm', 'Cơm gà chiên mắm là một món ăn đặc trưng và hấp dẫn của ẩm thực Việt Nam, nổi bật với sự kết hợp giữa cơm trắng dẻo thơm và gà chiên giòn thấm đượm hương vị đậm đà của nước mắm.', 'Gà chiên mắm, Cơm trắng, Rau sống và dưa chua, Nước chấm, Trang trí và gia vị', 463, 37, 48000, 18, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(5, 'Cơm Gà Sốt Tiêu Đen', 'Cơm gà sốt tiêu đen là một món ăn hấp dẫn với hương vị đậm đà và cay nồng của sốt tiêu đen, kết hợp hoàn hảo với cơm trắng dẻo thơm và thịt gà mềm ngọt.', 'Gà, gạo tẻ, tiêu đen, tỏi, hành tây, nước tương, dầu hào, đường, muối, tiêu xay, bột ngô, rau sống (xà lách, dưa leo, cà chua)', 50, 22, 48000, 19, '2024-04-20 05:02:39', '2024-05-31 15:48:07'),
(6, 'Cơm Gà sốt Chua Ngọt', 'Cơm gà sốt chua ngọt là một món ăn ngon miệng với sự kết hợp hài hòa giữa vị chua, ngọt và mặn, tạo nên hương vị phong phú và hấp dẫn. Đây là món ăn phổ biến, được nhiều người yêu thích nhờ hương vị đậm đà và dễ ăn.', 'Gà, gạo tẻ, ớt chuông, hành tây, dứa, cà chua, tỏi, giấm, đường, nước tương, dầu hào, tương cà, nước mắm, bột ngô, rau sống (xà lách, dưa leo, cà chua).', 389, 15, 48000, 14, '2024-04-20 05:02:39', '2024-06-07 03:58:09'),
(7, 'Bún Bò Trộn Nam Bộ', 'Bún bò trộn Nam Bộ là một món ăn đặc trưng của miền Nam Việt Nam, mang hương vị tươi mát, thanh nhẹ, và đậm đà, phù hợp cho những ngày nắng nóng. Món ăn này nổi bật với sự kết hợp giữa bún tươi mềm, thịt bò xào thơm lừng và rau sống tươi ngon, tất cả hòa quyện trong nước mắm chua ngọt đặc trưng', 'Bún tươi, thịt bò, giá đỗ, rau sống (xà lách, rau thơm, húng quế, tía tô), dưa leo, cà rốt, đậu phộng rang, hành phi, tỏi, ớt, đường, nước mắm, nước cốt chanh.', 69, 34, 88000, 11, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(8, 'Bún Trộn Nem Nướng', 'Bún trộn nem nướng là một món ăn nổi tiếng của ẩm thực Việt Nam, đặc biệt phổ biến ở các vùng miền Nam. Món ăn này kết hợp hài hòa giữa bún tươi mềm, nem nướng thơm lừng và các loại rau sống tươi ngon, tạo nên một hương vị đậm đà và hấp dẫn.', 'Bún, nem nướng, rau sống (xà lách, rau thơm, rau mùi), dưa leo, đồ chua (cà rốt, củ cải trắng), đậu phộng rang, hành phi, tỏi, ớt, giấm, đường, nước mắm, nước cốt chanh.', 459, 47, 51000, 13, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(9, 'Bún Trộn Thịt Gà', 'Bún trộn thịt gà là một món ăn phổ biến và ngon miệng trong ẩm thực Việt Nam, đặc biệt là vào những ngày nắng nóng. Món ăn này kết hợp giữa sự dẻo của bún, vị ngọt của thịt gà và sự tươi mát của rau sống, tạo nên một hương vị độc đáo và hấp dẫn.', 'Bún, thịt gà (thường là ức gà hoặc đùi gà), rau sống (xà lách, rau mùi, rau răm), dưa leo, hành tây, hành phi, đậu phộng rang, tiêu, dầu ăn, nước mắm, đường, tỏi, ớt', 367, 11, 59000, 11, '2024-04-20 05:02:39', '2024-06-01 09:28:23'),
(10, 'Hủ tiếu Nam Vang', 'Hủ tiếu Nam Vang là một món ăn đặc trưng của ẩm thực miền Nam Việt Nam, mang hương vị độc đáo và phong phú. Món ăn này thường được thưởng thức vào bữa sáng hoặc buổi tối.', 'Bánh hủ tiếu, thịt heo, tôm, hành tây, tỏi, rau sống (rau mầm, rau cải, rau thơm), đậu phụ, nước dùng (nước dùng từ xương gà hoặc xương heo), dầu ăn, dầu mè, mì chính, đường, nước mắm, tiêu.', 437, 9, 59000, 16, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(11, 'Hủ tiếu xương', 'Hủ tiếu xương là một món ăn phổ biến trong ẩm thực miền Nam Việt Nam, nổi tiếng với hương vị đậm đà và dinh dưỡng từ xương heo. Đây là một lựa chọn tuyệt vời cho bữa sáng hoặc bữa tối', 'Bánh hủ tiếu, xương heo, hành tây, tỏi, rau sống (rau mầm, rau cải, rau thơm), đậu phụ, nước dùng (nước dùng từ xương heo), dầu ăn, mì chính, đường, nước mắm, tiêu.', 91, 10, 59000, 18, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(12, 'Hủ tiếu bò kho', 'Hủ tiếu bò kho là một món ăn phổ biến trong ẩm thực Việt Nam, kết hợp giữa hương vị đặc trưng của hủ tiếu và hương vị đậm đà của bò kho. Đây là một món ăn thơm ngon và bổ dưỡng, thích hợp cho mọi bữa ăn.', 'Bún hủ tiếu, thịt bò (thường là thăn bò), cà rốt, khoai tây, hành tây, tỏi, nước dừa, nước dùng bò (hoặc nước dùng từ xương bò), dầu ăn, dầu mè, mì chính, đường, nước mắm, tiêu, ớt.', 163, 30, 55000, 13, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(13, 'Hủ tiếu hải sản', 'Hủ tiếu hải sản là một món ăn phổ biến trong ẩm thực Việt Nam, kết hợp hương vị đặc trưng của hủ tiếu với hương vị tươi ngon của hải sản. Đây là một món ăn hấp dẫn và đa dạng, phù hợp cho mọi dịp ăn.', 'Bún hủ tiếu, hải sản (tôm, mực, cá viên, sò điệp), rau sống (xà lách, rau mầm, rau thơm), hành tím, tỏi, nước dùng (nước dùng từ xương hải sản hoặc từ cá), dầu ăn, dầu mè, mì chính, đường, nước mắm, tiêu.', 82, 29, 63000, 11, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(14, 'Mì xào bò', 'Mì xào bò là một món ăn phổ biến và ngon miệng, thích hợp cho cả bữa ăn trưa hoặc bữa tối. Hương vị đậm đà của thịt bò kết hợp với mùi thơm của hành tỏi và hành tây tạo nên một trải nghiệm ẩm thực tuyệt vời.', 'Mì (loại mì gói hoặc mì spaghetti), thịt bò (thường là thăn bò), hành tây, hành tỏi, hành lá, gia vị (nước mắm, đường, tiêu, dầu ăn), rau sống hoặc rau cải.', 157, 38, 79000, 17, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(15, 'Bánh mì bò kho', 'Bánh mì bò kho là một món ăn ngon và bổ dưỡng, phổ biến trong ẩm thực Việt Nam. Hương vị đậm đà của thịt bò kho kết hợp với vị ngọt của hành tây và hương thơm của tỏi tạo nên một trải nghiệm ẩm thực tuyệt vời khi kết hợp cùng bánh mì giòn tan.', 'Bánh mì, thịt bò (thường là thăn bò), hành tây, tỏi, nước dừa, nước dùng (có thể là nước dùng từ xương bò), dầu ăn, mì chính, đường, nước mắm, tiêu, hành lá.', 367, 36, 55000, 10, '2024-04-20 05:02:39', '2024-06-01 09:28:23'),
(16, 'Kimpap Chiên', 'Kimbap chiên là một biến thể ngon miệng của kimbap truyền thống, với vị giòn và thơm của bánh mì chiên cùng hương vị đặc trưng của kimbap. Bạn có thể thêm hoặc thay đổi nguyên liệu theo sở thích cá nhân để tạo ra những phong vị đa dạng.', 'Gạo nếp, rong biển (nori), trứng gà, cà rốt, dưa leo, hành tây, dầu ăn hoặc dầu hướng dương, muối, tiêu.', 288, 30, 37000, 11, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(17, 'Mỳ Tương Đen Cay', 'Mỳ tương đen cay là một món mỳ đặc trưng trong ẩm thực Á Đông, nổi tiếng với hương vị đậm đà, thơm ngon và cay nồng từ tương đen và gia vị. Mỳ này thường được kết hợp với các loại thực phẩm khác như thịt bò, thịt gà hoặc hải sản, tạo nên một bữa ăn đầy đủ và bổ dưỡng.', 'Mỳ (spaghetti hoặc mỳ trứng), tương đen, tỏi, ớt cay, dầu ăn, muối, đường, tiêu, thịt bò (hoặc thịt gà, hoặc hải sản như tôm, mực hoặc cá).', 154, 42, 35000, 12, '2024-04-20 05:02:39', '2024-06-01 09:35:41'),
(18, 'Trà sữa trứng muối', 'Trà sữa trứng muối là một biến thể độc đáo và ngon miệng của trà sữa truyền thống, với hương vị ngọt ngào của sữa và độ mặn của trứng muối, tạo nên một trải nghiệm thú vị cho người thưởng thức.', 'Trà đen, sữa đặc, trứng gà, đường, muối.', 364, 40, 43000, 20, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(19, 'Trà Sữa Phô Mai Tươi', 'Trà sữa phô mai tươi là một sự kết hợp độc đáo giữa hương vị trà thơm ngon và sự béo ngậy của phô mai tươi, tạo ra một đồ uống tròn vị và hấp dẫn.', 'Trà đen, sữa tươi, phô mai tươi, đường.', 369, 39, 40000, 12, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(20, 'Trà Sữa Tocotoco Ba Anh Em', 'Trà sữa Tocotoco Ba Anh Em là một sự pha trộn độc đáo giữa hương vị trà đen thơm ngon và sự bổ sung của hạt tocotrienol, tạo ra một đồ uống đặc biệt và bổ dưỡng.', 'Trà đen, sữa tươi, tocotrienol (tinh dầu gạo lứt), đường.', 85, 28, 38000, 11, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(21, 'Trà Sữa Toco Trân Châu Hoàng Gia', 'Trà sữa Toco Trân Châu Hoàng Gia mang đến hòa quyện hương vị trà đen thơm ngon và sự phong phú của trân châu, tạo ra một trải nghiệm thưởng thức độc đáo và lịch lãm.', 'Trà đen, sữa tươi, trân châu, đường.', 436, 9, 830000, 10, '2024-04-20 05:02:39', '2024-05-28 01:58:01'),
(22, 'Trà Sữa Toco Trân Châu Sợi', 'Trà sữa Toco Trân Châu Sợi kết hợp hương vị trà đen thơm ngon với sự ngọt dịu và độ dai của trân châu sợi, tạo nên một đồ uống thơm ngon và phong phú.', 'Trà đen, sữa tươi, trân châu sợi, đường.', 220, 39, 39000, 18, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(23, 'Ô Long Thái Cực', 'Ô Long Thái Cực là một loại trà được chế biến từ lá trà ô long, kết hợp với các loại thảo dược Thái Cực truyền thống, tạo ra hương vị độc đáo và hấp dẫn.', 'á trà ô long, các loại thảo dược Thái Cực (như hoa cúc, hoa hồng, lá sen, lá bạch đàn), nước nóng.', 190, 36, 39000, 19, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(24, 'Trà Sữa Xanh Vị Nhài', 'Trà Sữa Xanh Vị Nhài mang đến sự kết hợp tinh tế giữa hương vị đặc trưng của trà xanh và mùi thơm dễ chịu của hoa nhài, tạo nên một trải nghiệm thưởng thức trà sữa độc đáo và dễ chịu.', 'Trà xanh, sữa tươi, nhụy hoa nhài (hoặc hương liệu nhài tổng hợp), đường.', 154, 39, 39000, 11, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(25, 'Trà Sữa Bạc Hà', 'Trà Sữa Bạc Hà là sự pha trộn hài hòa giữa hương vị đặc trưng của trà đen và hương thơm mát của bạc hà, tạo nên một đồ uống trà sữa thơm ngon và sảng khoái.', 'Trà đen, sữa tươi, bạc hà (tươi hoặc hương liệu), đường.', 117, 28, 39000, 20, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(26, 'Trà Sữa Socola', 'Trà Sữa Socola là sự phối hợp hài hòa giữa hương vị đậm đà của trà đen và sự ngọt ngào của socola, tạo ra một đồ uống trà sữa ngon ngọt và thơm phức.', 'Trà đen, socola (sirô hoặc bột cacao), sữa tươi, đường.', 420, 48, 39000, 15, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(27, 'Trà Sữa Matcha', 'Trà Sữa Matcha là sự kết hợp tinh tế giữa hương vị đặc trưng của trà matcha Nhật Bản và sự béo ngậy của sữa tươi, tạo ra một đồ uống trà sữa độc đáo và bổ dưỡng.', 'Trà matcha, sữa tươi, đường.', 332, 32, 39000, 14, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(28, 'Cơm thố rau củ', 'Cơm thố rau củ là một món ăn dân dã, bổ dưỡng và dễ chuẩn bị, được chế biến từ cơm trắng và các loại rau củ tươi ngon, tạo thành một bữa ăn cân đối và dinh dưỡng.', 'Cơm trắng, cà rốt, bắp cải, cần tây, hành tây, nấm, đậu hủ, dầu ăn, tỏi, muối, tiêu, và các gia vị khác tùy khẩu vị.', 247, 38, 30000, 17, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(29, 'Cơm Thố Bò Xá Xíu', 'Cơm thố bò xá xíu là một món ăn hấp dẫn và bổ dưỡng, kết hợp giữa thịt bò mềm mại và xá xíu thơm ngon, được phục vụ trên cơm trắng, tạo nên một bữa ăn cân đối và ngon miệng.', 'Cơm trắng, thịt bò (thăn bò hoặc thịt bò sống), xá xíu, dầu ăn, tỏi, gia vị (muối, tiêu, đường), nước sốt xá xíu (hoặc nước mắm, nước tương, đường, tỏi), rau sống trang trí (xà lách, cà rốt).', 429, 13, 50000, 12, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(30, 'Cơm thố sườn nướng', 'Cơm thố sườn nướng là một món ăn ngon miệng và bổ dưỡng, với sườn heo nướng vàng và giòn, được phục vụ trên cơm trắng, tạo nên một bữa ăn ngon lành và đầy đủ chất dinh dưỡng.', 'Cơm trắng, sườn heo, gia vị (muối, tiêu, đường, tỏi), dầu ăn (hoặc dầu hướng dương), nước mắm, tỏi băm, lá mùi, rau sống trang trí (xà lách, cà rốt).', 349, 49, 62000, 11, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(31, 'Bánh Gà', 'Bánh gà là một món bánh ngọt phổ biến, thường có hình dáng và hương vị giống như một con gà nhỏ, thường được làm từ bột mì, đường và các nguyên liệu khác, tạo nên một hương vị đặc trưng và hấp dẫn.', 'Bột mì, đường, bơ, trứng, bột nở (baking powder), sữa, gia vị tùy chọn (vanilla, muối), và nguyên liệu trang trí như hạt dẻ cười, socola, hoặc mứt trái cây.', 287, 42, 7000, 17, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(32, 'Mỳ Sốt Thịt Băm', 'Mỳ sốt thịt băm là một món ăn phổ biến và ngon miệng, với mỳ mềm và thơm được kết hợp cùng sốt thịt băm đậm đà, tạo nên một bữa ăn cảm giác và ngon lành.', 'Mỳ (loại mỳ spaghetti hoặc loại mỳ tươi), thịt bò hoặc thịt heo băm, cà chua, hành tỏi, gia vị (muối, tiêu, đường, gia vị thịt băm), dầu ăn, rau mùi hoặc hành lá để trang trí.', 222, 13, 40000, 11, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(33, 'Trà đào', 'Trà đào là một thức uống giải khát thơm ngon, kết hợp hương vị trà đen đậm đà với vị ngọt tự nhiên và hương thơm dịu nhẹ của đào, mang lại cảm giác sảng khoái và dễ chịu.', 'Trà đen, đào (trái đào tươi hoặc đóng hộp), đường hoặc mật ong, nước, đá (tùy chọn).', 390, 23, 35000, 14, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(34, 'Trà chanh', 'Trà chanh là một đồ uống phổ biến và truyền thống, kết hợp giữa hương vị của trà và vị chua ngọt của chanh, tạo nên một thức uống sảng khoái và dễ thương thức.', 'Trà (loại trà đen hoặc trà xanh), chanh (nước chanh và lát chanh để trang trí), đường hoặc mật ong, đá (tùy chọn).', 324, 49, 15000, 18, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(35, 'Cháo sườn Sụn', 'Cháo sườn sụn là một món ăn truyền thống, đậm đà và bổ dưỡng, với hương vị ngọt thanh từ sườn sụn ninh nhừ kết hợp cùng cháo trắng mềm mịn, tạo nên một món ăn dễ tiêu hóa và phù hợp cho mọi lứa tuổi.', 'Gạo, sườn sụn, hành tím, tỏi, nước dùng (nước xương), muối, tiêu, hành lá, rau mùi.', 428, 9, 30000, 17, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(36, 'Cháo lòng', 'Cháo lòng là một món ăn truyền thống của Việt Nam, có hương vị đậm đà và giàu dinh dưỡng. Món ăn này kết hợp cháo gạo mềm mịn với các loại nội tạng heo như lòng, gan, dạ dày, tạo nên một món ăn hấp dẫn và bổ dưỡng.', 'Gạo, lòng heo (bao gồm lòng, gan, dạ dày), nước dùng (nước xương heo), hành tím, tỏi, nước mắm, muối, tiêu, hành lá, rau mùi.', 411, 26, 25000, 12, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(37, 'Cháo gà', 'Cháo gà là một món ăn truyền thống và dễ tiêu hóa, được nấu từ gạo và thịt gà, mang đến hương vị thơm ngon và bổ dưỡng, phù hợp cho mọi lứa tuổi và đặc biệt thích hợp khi cảm thấy không khỏe.', 'Gạo, thịt gà, nước dùng gà, hành tím, tỏi, nước mắm, muối, tiêu, hành lá, rau mùi, gừng.', 71, 36, 20000, 19, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(38, 'Cháo gà ác', 'Cháo gà ác là một món ăn truyền thống, bổ dưỡng, được chế biến từ gạo và gà ác, loại gà có thịt đen và giá trị dinh dưỡng cao, thường được sử dụng trong y học cổ truyền để bồi bổ sức khỏe.', 'Gạo, gà ác, nước dùng gà, hành tím, tỏi, nước mắm, muối, tiêu, hành lá, rau mùi, gừng, hạt sen.', 72, 36, 35000, 11, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(39, 'Cháo thịt bằm', 'Cháo thịt bằm là một món ăn ngon miệng và dễ tiêu, thường được nấu từ gạo và thịt bằm, tạo nên hương vị đậm đà và bổ dưỡng. Món cháo này rất phù hợp cho bữa sáng hoặc bữa ăn nhẹ.', 'Gạo, thịt heo bằm, nước dùng (nước xương heo hoặc gà), hành tím, tỏi, nước mắm, muối, tiêu, hành lá, rau mùi.', 297, 82, 25000, 15, '2024-04-20 05:02:39', '2024-06-07 03:58:22'),
(40, 'Cháo dinh dưỡng', 'Cháo dinh dưỡng là một món ăn bổ dưỡng và dễ tiêu, thường được nấu từ gạo kết hợp với các loại rau củ và thịt hoặc hải sản, cung cấp đầy đủ các chất dinh dưỡng cần thiết cho cơ thể. Món cháo này rất phù hợp cho trẻ nhỏ, người già, và những người cần phục hồi sức khỏe.', 'Gạo, thịt (gà, heo, bò) hoặc hải sản (tôm, cá), rau củ (cà rốt, khoai tây, bí đỏ, cải bó xôi), nước dùng (nước xương), hành tím, tỏi, nước mắm, muối, tiêu, hành lá, rau mùi.', 196, 48, 30000, 12, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(41, 'Bún chả hà nội', 'Bún chả Hà Nội là một món ăn đặc trưng của ẩm thực Hà Nội, với bún tươi kết hợp cùng chả thịt nướng thơm lừng, nước chấm chua ngọt đậm đà và các loại rau sống tươi ngon. Đây là món ăn mang hương vị độc đáo và khó quên của thủ đô Việt Nam.', 'Bún tươi, thịt heo (thịt ba chỉ và thịt nạc vai), nước mắm, đường, giấm, tỏi, ớt, cà rốt, đu đủ xanh, rau sống (xà lách, húng quế, rau thơm), hành khô, tiêu, muối, dầu ăn.', 51, 8, 35000, 16, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(42, 'Bún đậu mắm tôm', 'Bún đậu mắm tôm là một món ăn dân dã của miền Bắc Việt Nam, nổi bật với bún tươi, đậu phụ chiên giòn, thịt luộc, chả cốm và mắm tôm đặc trưng. Món ăn này thường được thưởng thức cùng các loại rau sống tươi ngon, tạo nên hương vị đậm đà và hấp dẫn.', 'Bún tươi, đậu phụ, thịt heo luộc, chả cốm, mắm tôm, đường, chanh, ớt, tỏi, dầu ăn, rau sống (xà lách, húng quế, kinh giới, tía tô).', 488, 6, 35000, 14, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(43, 'Bún bò huế', 'Bún bò Huế là một món ăn đặc sản nổi tiếng của Huế, với nước dùng đậm đà từ xương bò và sả, kết hợp với bún tươi, thịt bò thái lát, giò heo và chả cua, tạo nên một món ăn hấp dẫn và đậm chất Trung Bộ.', 'Bún tươi, thịt bò (bắp bò hoặc nạm bò), giò heo, chả cua, huyết heo, sả, hành tím, tỏi, nước mắm, mắm ruốc Huế, ớt bột, dầu ăn, hành lá, rau răm, rau sống (giá đỗ, rau thơm, bắp chuối bào), chanh, tiêu, muối, đường.', 71, 10, 35000, 12, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(44, 'Bún riêu', 'Bún riêu là một món ăn truyền thống của Việt Nam, phổ biến khắp các miền đất nước. Món này bao gồm bún tươi kết hợp với nước dùng đặc trưng từ cua và cà chua, thêm vào đó là các loại thịt như thịt bắp, chả, và rau sống, tạo nên một hương vị độc đáo và phong phú.', 'Bún tươi, cua đồng, cà chua, thịt bắp, chả, hành tím, mắm tôm, nước mắm, nước dừa, quả dưa leo, quả ớt, rau sống (rau thơm, rau mầm, xà lách), mỡ hành, dầu ăn, tiêu, muối, đường, rau ngổ.', 91, 48, 35000, 19, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(45, 'Bún thịt nướng', 'Bún thịt nướng là một món ăn phổ biến trong ẩm thực Việt Nam, với bún tươi được kết hợp với thịt heo nướng mỡn và thơm phức, thêm vào đó là các loại rau sống và nước mắm chua ngọt, tạo nên một món ăn ngon và dễ ăn.', 'Bún tươi, thịt heo (thịt vai hoặc thịt ba chỉ), nước mắm, đường, chanh, tỏi, ớt, dầu ăn, rau sống (xà lách, rau thơm, hành lá, hành phi), đậu phụng rang, dưa leo, hành tím.', 438, 46, 35000, 18, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(46, 'Bún mắm', 'Bún mắm là một món ăn đặc trưng của miền Nam Việt Nam, nổi tiếng với hương vị đặc trưng và thơm ngon của nước mắm pha chế kết hợp với bún tươi và các loại gia vị, rau sống. Món ăn này thường được thưởng thức với thịt heo nướng hoặc các loại đồ biển.', 'Bún tươi, nước mắm, đường, chanh, tỏi, ớt, dầu ăn, rau sống (xà lách, rau thơm, hành lá, hành phi), thịt heo nướng hoặc các loại đồ biển (tôm, mực, cá), đậu phụng rang, dưa leo.', 143, 10, 30000, 12, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(47, 'Phở cuốn', 'Phở cuốn là một món ăn phổ biến trong ẩm thực Việt Nam, được làm từ bánh phở mềm mịn cuốn cùng thịt bò hoặc thịt gà, rau sống và gia vị. Món ăn này thường được thưởng thức kèm với nước mắm chua ngọt pha chế.', 'Bánh phở, thịt bò hoặc thịt gà, rau sống (rau sống, rau mầm, rau thơm), giá đỗ, bún tươi, tỏi, ớt, nước mắm, đường, chanh.', 120, 44, 20000, 16, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(48, 'Phở bò', 'Phở bò là một món ăn truyền thống của Việt Nam, có nguồn gốc từ miền Bắc, nổi tiếng với hương vị đậm đà và thơm ngon của nước dùng phở, bò thái lát, và các loại gia vị. Món ăn này thường được thưởng thức với bún và rau sống.', 'Bún phở, thịt bò (thường là thịt tái, thịt chín), nước dùng phở, hành tây, hành lá, ngò gai, húng quế, ớt, mùi tàu, gừng, hạt tiêu, bún tươi, rau sống (xà lách, rau thơm), gia vị (nước mắm, đường, muối, tiêu).', 340, 34, 35000, 17, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(49, 'Phở gà', 'Phở gà là một biến thể của món phở truyền thống, nổi tiếng với hương vị nhẹ nhàng và đậm đà của nước dùng gà, kết hợp với thịt gà thái lát, bún và các loại gia vị. Món ăn này thường được thưởng thức với rau sống và gia vị theo khẩu vị cá nhân.', 'Bún phở, thịt gà (thường là ức gà), nước dùng gà, hành tây, hành lá, ngò gai, ớt, mùi tàu, gừng, hạt tiêu, rau sống (xà lách, rau thơm), gia vị (nước mắm, đường, muối, tiêu).', 208, 2, 30000, 14, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(50, 'Phở trộn', 'Phở trộn là một biến thể độc đáo của món phở, thay vì nước dùng được phục vụ riêng biệt, các thành phần của phở được trộn chung với nhau và thưởng thức như một món salad. Món ăn này thường bao gồm bún, thịt, rau sống, gia vị và nước mắm chua ngọt.', 'Bún phở, thịt bò hoặc thịt gà, rau sống (rau xanh, hành lá, rau mầm), giá đỗ, hành tím, tỏi, ớt, nước mắm, đường, chanh, dầu ăn.', 432, 30, 30000, 19, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(51, 'Cơm rang dưa bò', 'Cơm rang dưa bò là một món ăn phổ biến trong ẩm thực Việt Nam, với cơm trắng được rang cháy vàng cùng với thịt bò thái lát và dưa leo. Món ăn này có vị ngọt tự nhiên từ dưa leo và hương vị đặc trưng từ thịt bò, tạo nên một bữa ăn hấp dẫn.', 'Cơm trắng, thịt bò, dưa leo, hành tím, tỏi, ớt, nước mắm, đường, dầu ăn, hành lá, rau mùi, tiêu.', 330, 33, 30000, 12, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(52, 'Cơm rang hải sản', 'Cơm rang hải sản là một món ăn phổ biến trong ẩm thực Việt Nam, với cơm trắng được rang cháy vàng cùng với hải sản như tôm, mực, cá và các loại hải sản khác. Món ăn này thường được thêm các loại rau củ và gia vị để tạo nên một hương vị đậm đà và hấp dẫn.', 'Cơm trắng, tôm, mực, cá (hoặc các loại hải sản khác như cua, ghẹ...), hành tím, tỏi, ớt, nước mắm, đường, dầu ăn, hành lá, rau mùi, tiêu.', 469, 50, 40000, 15, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(53, 'Cơm rang trứng', 'Cơm rang trứng là một món ăn phổ biến và dễ làm, với cơm trắng được rang cháy vàng cùng với trứng gà, tạo nên một món ăn đơn giản nhưng ngon miệng và bổ dưỡng. Món này thường được thêm các loại rau củ và gia vị để tăng thêm hương vị.', 'Cơm trắng, trứng gà, hành tím, tỏi, ớt, nước mắm, đường, dầu ăn, hành lá, rau mùi, tiêu.', 63, 14, 25000, 20, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(54, 'Cơm tấm', 'Cơm tấm là một món ăn phổ biến và truyền thống của Việt Nam, thường được chế biến từ gạo tấm, thịt heo hoặc gà, trứng, và được phục vụ cùng với rau sống, dưa leo, chả trứng, và nước mắm pha chế. Món này thường có vị ngọt của nước mắm và thơm của cơm nấu.', 'Gạo tấm, thịt heo hoặc gà, trứng, dưa leo, rau sống (xà lách, rau thơm), chả trứng, nước mắm pha, hành phi, tiêu, dầu ăn.', 89, 23, 35000, 14, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(55, 'Chè sữa chua mít', 'Chè sữa chua mít là một món tráng miệng ngon và bổ dưỡng, kết hợp giữa vị ngọt của đồ ngọt, vị chua dịu của sữa chua và hương vị thơm của mít. Món này thường được làm từ sữa chua, mít và đường, tạo nên một hương vị độc đáo và phong phú.', 'Sữa chua, mít, đường, nước cốt dừa (tùy chọn), đá viên (tùy ý).', 332, 14, 15000, 19, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(56, 'Chè dưỡng nhan', 'Chè dưỡng nhan là một món tráng miệng phổ biến trong ẩm thực truyền thống của Việt Nam, được cho là có tác dụng tốt cho làn da và sức khỏe. Món này thường được làm từ các loại hạt như đậu đen, đậu xanh, và thêm các loại thảo mộc tự nhiên như hoa quả lựu, đậu đỏ, và nấm linh chi.', 'Đậu đen, đậu xanh, hoa quả lựu, đậu đỏ, nấm linh chi, đường, nước cốt dừa (tùy chọn), đá viên (tùy ý).', 229, 21, 40000, 12, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(57, 'Bánh tráng trộn', 'Bánh tráng trộn là một món ăn vặt phổ biến và rất được ưa chuộng ở các khu vực đô thị của Việt Nam. Món này thường được làm từ bánh tráng bị thái nhỏ, sau đó trộn đều với các nguyên liệu như tôm khô, bò khô, trứng gà, dầu hào, dầu ăn, hành phi, mỡ hành, bột ngọt, tiêu, và một số gia vị khác.', 'Bánh tráng, tôm khô, bò khô, trứng gà, dầu hào, dầu ăn, hành phi, mỡ hành, bột ngọt, tiêu, gia vị tùy chọn (ớt bột, hành tỏi, rau mùi...).', 181, 50, 20000, 13, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(58, 'Bánh xèo', 'Bánh xèo là một món ăn truyền thống của Việt Nam, được làm từ bột gạo, nước cốt dừa, nước lọc và nước turmeric để tạo màu sắc và hương vị đặc trưng. Bánh xèo thường được nhân với thịt heo hoặc tôm, và thường được ăn kèm với rau sống và nước mắm pha chế.', 'Bột gạo, nước cốt dừa, nước lọc, nước turmeric, thịt heo hoặc tôm, hành tím, đậu xanh, hành lá, rau sống (xà lách, rau thơm), dầu ăn, nước mắm, đường, tiêu.', 187, 35, 35000, 12, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(59, 'Bánh khọt', 'Bánh khọt là một món ăn truyền thống phổ biến ở miền Nam Việt Nam. Bánh được làm từ bột gạo, nước cốt dừa và nước lọc, sau đó được nướng trên khuôn nhỏ đặc biệt. Bánh khọt thường có nhân từ tôm tươi hoặc thịt heo, được ăn kèm với rau sống và nước mắm pha chế.', 'Bột gạo, nước cốt dừa, nước lọc, tôm tươi hoặc thịt heo, hành lá, dầu ăn, nước mắm, đường, tiêu, hành phi, rau sống (xà lách, rau thơm).', 176, 20, 33000, 19, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(60, 'Bánh chuối', 'Bánh chuối là một món tráng miệng ngon và phổ biến, được làm từ chuối chín, bột mì, đường và các nguyên liệu khác như trứng, sữa, và bơ. Bánh chuối thường có hương vị ngọt ngào của chuối và một lớp vỏ ngoài giòn tan.', 'Chuối chín, bột mì, đường, trứng, sữa, bơ, bột nở, muối, vani (tùy chọn), hạt hồ hạnh (tùy chọn).', 407, 25, 20000, 20, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(61, 'Bánh khoai', 'Bánh khoai là một món tráng miệng phổ biến, thường được làm từ khoai lang hoặc khoai mì. Bánh có thể được chế biến dưới nhiều dạng khác nhau như bánh khoai mì nướng, bánh khoai mì hấp, hoặc bánh khoai lang chiên. Bánh thường có vị ngọt tự nhiên từ khoai và thường được thêm đường, sữa và trứng để tạo hương vị đa dạng.', 'Khoai lang hoặc khoai mì, đường, sữa, trứng, bột mì, bột nở, bơ (tùy chọn), muối, vani (tùy chọn).', 447, 26, 20000, 12, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(62, 'Gà rán KFC', 'Gà rán KFC là một món ăn nhanh nổi tiếng trên toàn thế giới, đặc trưng bởi lớp vỏ ngoài giòn rụm và phần thịt gà mềm mọng, thấm đẫm gia vị. Món gà này được chiên ngập dầu sau khi đã tẩm ướp với các loại gia vị bí truyền, tạo nên hương vị đặc trưng và hấp dẫn.', 'Thịt gà (đùi, cánh, ức), bột mì, bột bắp, trứng, sữa, muối, tiêu, bột tỏi, bột hành, bột ớt, bột paprika, dầu ăn.', 245, 4, 40000, 12, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(63, 'Bánh mì chảo', 'Bánh mì chảo là một món ăn sáng phổ biến tại Việt Nam, đặc trưng bởi bánh mì giòn ăn kèm với các nguyên liệu được chế biến và bày biện trong một chiếc chảo nóng. Món ăn này thường bao gồm trứng ốp la, xúc xích, pate, thịt nguội và đôi khi có thêm thịt bò, hành tây, cùng nước sốt thơm ngon.', 'Bánh mì, trứng, xúc xích, pate, thịt nguội, thịt bò, hành tây, cà chua, bơ, nước mắm, tiêu, muối, dầu ăn, rau mùi (tùy chọn).', 95, 49, 35000, 11, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(64, 'Bún cá chấm', 'Bún cá chấm là một món ăn độc đáo và hấp dẫn của ẩm thực Việt Nam, với bún tươi ăn kèm cá chiên giòn và nước chấm đậm đà. Cá được tẩm ướp gia vị, chiên vàng giòn, tạo nên hương vị đặc trưng, kết hợp với bún và các loại rau sống, mang lại một trải nghiệm ẩm thực tuyệt vời.', 'Bún tươi, cá (thường là cá rô phi hoặc cá lóc), bột chiên giòn, hành tím, tỏi, ớt, rau sống (xà lách, rau thơm, kinh giới), nước mắm, chanh, đường, dầu ăn, tiêu, muối.', 101, 34, 25000, 19, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(65, 'Gà ủ muối', 'Gà ủ muối là một món ăn độc đáo và thơm ngon, nổi bật với hương vị đậm đà và thịt gà mềm mọng. Gà được ướp muối và các loại gia vị, sau đó ủ trong một thời gian nhất định để thấm đều gia vị, giữ nguyên hương vị tự nhiên và ngọt thịt.', 'Gà nguyên con, muối hạt, sả, gừng, lá chanh, hạt tiêu, ớt, hành tím, tỏi, rượu trắng (tùy chọn).', 432, 13, 150000, 14, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(68, 'Bún mẹt', 'Bún mẹt là một món ăn đặc sản của miền Bắc Việt Nam, được trình bày đẹp mắt trên mẹt tre lót lá chuối, gồm nhiều thành phần như bún tươi, chả, nem rán, thịt luộc, và các loại rau sống. Món ăn này không chỉ hấp dẫn bởi hương vị mà còn bởi sự đa dạng và phong phú của các nguyên liệu, tạo nên một bữa ăn đầy đủ và ngon miệng.', 'Bún tươi, chả lụa, nem rán, thịt heo luộc, giò tai, dưa leo, rau sống (xà lách, rau thơm, húng quế, kinh giới), hành phi, lạc rang, tỏi, ớt, nước mắm pha, chanh, đường, tiêu, muối.', 153, 130, 30000, 14, '2024-04-20 05:02:39', '2024-06-01 09:35:41'),
(69, 'Bánh su kem', 'Bánh su kem là một món tráng miệng phổ biến với lớp vỏ bánh mềm mịn và nhân kem mát lạnh, thơm ngon. Vỏ bánh được làm từ bột nhồi choux, nướng vàng giòn, sau đó được bơm đầy kem trứng ngọt ngào hoặc kem sữa béo ngậy, tạo nên một sự kết hợp hoàn hảo giữa hương vị và kết cấu.', 'Bột mì, bơ, nước, sữa, trứng, đường, muối, bột bắp, vani.', 52, 19, 55000, 15, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(76, 'Bánh mì thịt', 'Bánh mì thịt là một món ăn đường phố phổ biến và đặc trưng của Việt Nam. Món ăn này gồm một chiếc bánh mì giòn rụm, được kẹp với các loại thịt như thịt heo nướng, chả lụa, hoặc thịt nguội, kết hợp với các loại rau sống và dưa chua, tạo nên hương vị đậm đà và thơm ngon.', 'Bánh mì, thịt heo nướng hoặc thịt nguội, chả lụa, dưa leo, cà rốt, củ cải trắng, rau ngò, pate, bơ, nước mắm, đường, muối, tiêu, ớt, tỏi.', 117, 33, 15000, 14, '2024-04-20 05:02:39', '2024-05-28 02:06:24'),
(91, 'Cơm Trộn Bò rau củ quả', 'Cơm trộn bò rau củ quả là một món ăn ngon miệng và bổ dưỡng, kết hợp giữa cơm trắng, thịt bò mềm thơm, và các loại rau củ quả tươi ngon. Món ăn này không chỉ hấp dẫn bởi sự đa dạng của nguyên liệu mà còn bởi hương vị phong phú, cân đối giữa thịt và rau, tạo nên một bữa ăn đầy đủ dinh dưỡng.', 'Cơm trắng, thịt bò, cà rốt, đậu Hà Lan, bông cải xanh, ớt chuông, hành tím, tỏi, nước tương, dầu hào, đường, muối, tiêu, dầu ăn, hành lá, rau mùi.', 381, 5, 35000, 14, '2024-04-20 05:02:39', '2024-05-28 02:06:24');
